import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (

<Router>
<Navbar/>
   <Routes>
        <Route exact path="/" element={
          <Home/>
        }>
        </Route>
        <Route exact path="/blog" element={
          <Input/>
        }>
        </Route>
    </Routes>

</Router>
)}

export default App;
